<html>
<head>
  <meta charset="utf-8">
  <title>Jasmine Spec Runner</title>

</head>
<body>
  <script src="file:///Users/ian/Code/xlsxjs/node_modules/jasmine-core/lib/jasmine-core/jasmine.js"></script>
<script src="file:///Users/ian/Code/xlsxjs/node_modules/jasmine-core/lib/jasmine-core/jasmine-html.js"></script>
<script src="file:///Users/ian/Code/xlsxjs/node_modules/jasmine-core/lib/jasmine-core/boot0.js"></script>
<script>
(function() {
  window.__jasmineDone = null;
  window.__jasmineFailures = 0;
  if (!window.jasmine || !window.jasmine.getEnv) {
    return;
  }
  window.jasmine.getEnv().addReporter({
    specDone: function(result) {
      if (result.status === 'failed') {
        window.__jasmineFailures += result.failedExpectations.length;
      }
    },
    jasmineDone: function(result) {
      window.__jasmineDone = result;
    }
  });
})();
</script>

</body>
